import React from 'react';
import Hero from 'components/Hero';
import Nav from 'components/Nav';
import Container from 'components/Container';
import { H1, H2, H3 } from 'components/Typography'


const herocontainer = styled.div`
	position: relative
`
const Home = () => {

  return (
    <div>
<herocontainer>
<Hero />


</herocontainer>
    <div>
    <Container>
        <H1>Moii</H1>
    </Container>
    </div>

    </div>


  );

}




export default Home;
